import Box from "../components/Menu/Menu";
import "bootstrap/dist/css/bootstrap.css";
import "../css/Main.css";
import "../css/index.css";
function Main() {
  return (
    <div className="wrap">
      <div className="Menu_wrap col-lg-12">
        <div className="container">
          <div className="MenuBox">
            <h1>COVID-19</h1>
            <Box text="Korea" />
            <Box text="World" />
            <Box text="선별진료소" />
          </div>
        </div>
      </div>
    </div>
  );
}
export default Main;
